import Navbar from "./Navbar"; // Import Navbar
import "./Dashboard.css";

function Dashboard() {
  return (
    <div className="dashboard">
      <Navbar /> {/* Use Navbar */}
      <h1>Welcome to the Dashboard</h1>
    </div>
  );
}

export default Dashboard;
